import React from 'react';
import './ProjectCard.css';

function ProjectCard(props) {
  return (
    <div className="card">
      <h1>{props.title}</h1>
      <img src={props.imgURL} alt={props.title} />
      <p>hello world</p>
      <button className='btn btn-'>Deployed App</button>
      <button className='btn btn-'>Github Repo</button>
    </div>
  );
}

export default ProjectCard;
